//import { Wrapper } from "./styled"
import {styled} from 'styled-components'

const Wrapper = styled.div`
    height: 100%;
    width: 100hv;
    border: 1px solid;
    margin 5px;
    background:red;
`;

export const Calendar = () => {
    return (
        <Wrapper>
            <ion-icon name="arrow-back-outline"></ion-icon>
            Oct 2022
            <ion-icon name="arrow-forward-outline"></ion-icon>
        </Wrapper>
    );
}
